import axios from 'axios';

export const BASE_PRODUCT_URL = '/produtos';

export async function post(data, url) {
    return axios({
        method: 'post',
        url,
        data
    });
}

export async function get(url, params) {
    return axios.get(
        url,
        params
    );
}
